import Cart from "./Cart";

const Navigation = () => {
  return (
    <nav>
      <h1 style={{ color: "red", display: "flex", marginLeft: "200px" }}>
        Pharmacy Menu
      </h1>
      <Cart />
    </nav>
  );
};
export default Navigation;
